package applyleetcode

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestReverseList(t *testing.T) {
	assert := assert.New(t)
	head := []int{1, 2, 3, 4, 5}
	expected := []int{5, 4, 3, 2, 1}
	assert.Equal(expected, reverseList(NewListNode(head)).GetValueArray())
}

func TestLengthOfLongestSubstring(t *testing.T) {
	assert := assert.New(t)
	// s := "pwwkew"
	s := "dvdf"
	expected := 3
	assert.Equal(expected, lengthOfLongestSubstring(s))
}

func TestLRUCache(t *testing.T) {
	assert := assert.New(t)
	cache := Constructor(2)
	assert.Equal(-1, cache.Get(2))
	cache.Put(2, 6)
	assert.Equal(-1, cache.Get(1))
	cache.Put(1, 5)
	cache.Put(1, 2)
	assert.Equal(2, cache.Get(1))
	assert.Equal(6, cache.Get(2))
}

func TestFindKthLargest(t *testing.T) {
	assert := assert.New(t)
	input := []int{3, 2, 3, 1, 2, 4, 5, 5, 6}
	k := 4
	expected := 4
	assert.Equal(expected, findKthLargest(input, k))
}

func TestReverseKGroup(t *testing.T) {
	assert := assert.New(t)
	head := []int{1, 2, 3, 4, 5}
	k := 2
	expected := []int{2, 1, 4, 3, 5}
	assert.Equal(expected, reverseKGroup(NewListNode(head), k).GetValueArray())
}

func TestThreeSum(t *testing.T) {
	assert := assert.New(t)
	nums := []int{0, 0, 0, 0}
	expected := [][]int{
		{0, 0, 0},
	}
	assert.Equal(expected, threeSum(nums))
}

func TestSortArray(t *testing.T) {
	assert := assert.New(t)
	nums := []int{5, 2, 3, 1}
	expected := []int{1, 2, 3, 5}
	sortArray(nums)
	assert.Equal(expected, nums)
}

func TestMaxSubArray(t *testing.T) {
	assert := assert.New(t)
	input := []int{-2, 1, -3, 4, -1, 2, 1, -5, 4}
	expected := 6
	assert.Equal(expected, maxSubArray(input))
}

func TestMergeTwoLists(t *testing.T) {
	assert := assert.New(t)
	l1 := NewListNode([]int{1, 2, 4})
	l2 := NewListNode([]int{1, 3, 4})
	expected := []int{1, 1, 2, 3, 4, 4}
	assert.Equal(expected, mergeTwoLists(l1, l2).GetValueArray())
}

func TestTwoSum(t *testing.T) {
	assert := assert.New(t)
	nums := []int{2, 7, 11, 15}
	target := 18
	expected := []int{1, 2}
	assert.Equal(expected, twoSum(nums, target))
}

func TestLevelOrder(t *testing.T) {
	assert := assert.New(t)
	root := []int{1, 2, 3, 4, -1, -1, 5}
	expected := [][]int{
		{1},
		{2, 3},
		{4, 5},
	}
	node := NewTreeNode(root)
	assert.Equal(expected, levelOrder(node))
}

func TestMaxProfit(t *testing.T) {
	assert := assert.New(t)
	input := []int{7, 1, 5, 3, 6, 4}
	expected := 5
	assert.Equal(expected, maxProfit(input))
	assert.Equal(expected, maxProfit2(input))
}

